import React, { useEffect, useState } from 'react'

function PeliculaDetail() {
    const [peli, setPeli] = useState({});

  return (
    <>
        <div>
            <h1>{peli.titulo}</h1>
            <p>{peli.descripcion}</p>
        </div>
    </>
  )
}

export default PeliculaDetail
